query:
fragment DiscountErrorFragment on DiscountError {
  code
  field
  __typename
}

fragment PageInfoFragment on PageInfo {
  endCursor
  hasNextPage
  hasPreviousPage
  startCursor
  __typename
}

fragment VoucherFragment on Voucher {
  id
  code
  startDate
  endDate
  usageLimit
  discountValueType
  discountValue
  countries {
    code
    country
    __typename
  }
  minSpent {
    currency
    amount
    __typename
  }
  minCheckoutItemsQuantity
  __typename
}

fragment VoucherDetailsFragment on Voucher {
  ...VoucherFragment
  type
  code
  usageLimit
  used
  applyOncePerOrder
  applyOncePerCustomer
  products(after: $after, before: $before, first: $first, last: $last) {
    edges {
      node {
        id
        name
        productType {
          id
          name
          __typename
        }
        isPublished
        thumbnail {
          url
          __typename
        }
        __typename
      }
      __typename
    }
    totalCount
    pageInfo {
      ...PageInfoFragment
      __typename
    }
    __typename
  }
  collections(after: $after, before: $before, first: $first, last: $last) {
    edges {
      node {
        id
        name
        products {
          totalCount
          __typename
        }
        __typename
      }
      __typename
    }
    totalCount
    pageInfo {
      ...PageInfoFragment
      __typename
    }
    __typename
  }
  categories(after: $after, before: $before, first: $first, last: $last) {
    edges {
      node {
        id
        name
        products {
          totalCount
          __typename
        }
        __typename
      }
      __typename
    }
    totalCount
    pageInfo {
      ...PageInfoFragment
      __typename
    }
    __typename
  }
  __typename
}

mutation VoucherCataloguesAdd($input: CatalogueInput!, $id: ID!, $after: String, $before: String, $first: Int, $last: Int) {
  voucherCataloguesAdd(id: $id, input: $input) {
    errors: discountErrors {
      ...DiscountErrorFragment
      __typename
    }
    voucher {
      ...VoucherDetailsFragment
      __typename
    }
    __typename
  }
}
